import axios from 'axios';
import { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import { MainContainer, RowDiv } from '../styles/StyledStore';
/**
 * # QuestionList
 *
 * ## init
 *
 * @KimTank
 *
 * ## modified
 *
 * @TODO
 *
 * ## description
 *
 * - 질문 리스트
 * - nested route(중첩 라우트로 목록눌렀을 때 상세로 이동)
 *
 * @returns QuestionList
 */
function Temp() {
  const [data, setData] = useState([]);

  const navigate = use

  useEffect(() => {
    axios
      .get('/board/posts', {
        withCredentials: true,
        params: {
          page: 1,
          size: 10,
        },
      })
      .then((response) => {
        const { data } = response;
        console.log(data.data);
        setData(data.data);
      })
      .catch((error) => alert(error));
  }, []);

  return (
    <MainContainer>
      <ul>
        {data.length === 0 ? (
          <li>not empty</li>
        ) : (
          data.map((data) => (
            <li key={data.id}>
              <Link to="questionDetail">
                <RowDiv>
                  <div>Title: {data.title}</div>
                  <div>{data.createdAt}</div>
                  <div>like {data.likeCount}</div>
                  <div>view {data.views}</div>
                </RowDiv>
                <div>
                  {data.tags.length === 0 ? (
                    <p>No tags</p>
                  ) : (
                    <p>data.tags[0]</p>
                    // <ul>
                    //   data.tags.map((tag, index) => (<li key={index}>tag</li>))
                    // </ul>
                  )}
                </div>
              </Link>
            </li>
          ))
        )}
      </ul>
    </MainContainer>
  );
}

export default Temp;
